Objet : Lettre de motivation pour intégrer le DUT GEA

Actuellement, élève de Terminale au Lycée du Parc Imperial, je souhaiterais débuter mon cursus dans votre établissement.
En effet, après m'être informé auprès d'amis issus de différents DUT, ainsi qu'à différents salons, la diversification de votre programme et de
vos unités d'enseignements sont conformes à ce que je souhaite faire plus tard.

J'espère, réaliser mes deux premières années avec d'excellentes notes dont l'objectif final serait de passer le concours SCORE IAE ainsi que
le TOIEC pour effectuer par la suite le Master Comptabilité, Contrôle, Audit.

J'espère également, intégrer votre établissement et pouvoir acquérir de nouvelles connaissances grâce à mon sérieux et mon envie
d'apprendre.


Je reste à votre disposition pour toutes informations complémentaires nécessaires.

Cordialement,
{{nom}} {{prenom}}

